// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract BitcoinUpDown is Ownable, ReentrancyGuard {
    enum UP_DOWN {
        UP,
        DOWN
    }
    struct Players {
        uint256 bet;
        UP_DOWN up_down;
        uint256 round;
        bool isExist;
    }
    mapping(address => Players) public players_bet;
    AggregatorV3Interface internal btcUsdPriceFeed;
    uint256 public round;
    mapping(uint256 => UP_DOWN) public roundWinner;
    int256 public price_open;
    int256 public price_close;
    mapping(uint256 => uint256) public prize_pool;
    mapping(uint256 => uint256) public prize_pool_up;
    mapping(uint256 => uint256) public prize_pool_down;
    uint256 public ts_start;
    uint256 private fee;
    address private dev;

    event eventStartRound(
        uint256 indexed round,
        uint256 indexed ts_start,
        int256 price_open,
        uint256 seed
    );
    event eventBet(
        uint256 indexed round,
        address indexed from,
        uint256 amount,
        UP_DOWN up_down
    );
    event eventEndTurn(
        uint256 indexed round,
        uint256 indexed ts_close,
        int256 price_close,
        uint256 prize_pool,
        uint256 prize_pool_up,
        uint256 prize_pool_down
    );
    event eventAddToPrizePool(
        uint256 indexed round,
        address indexed from,
        uint256 amount
    );

    constructor(address _priceFeedAddress) {
        dev = msg.sender;
        btcUsdPriceFeed = AggregatorV3Interface(_priceFeedAddress);
        _startRound(0); // 0 = no seed
    }

    function getPrice() public view returns (int256) {
        (, int256 price, , , ) = btcUsdPriceFeed.latestRoundData();
        return price;
    }

    function _calculateAmount(address _addr) private view returns (uint256) {
        // calculate the amount depending of player bet ratio to prizepool and direction
        uint256 roundPool = prize_pool[players_bet[_addr].round];
        uint256 betPool = players_bet[_addr].up_down == UP_DOWN.UP
            ? prize_pool_up[players_bet[_addr].round]
            : prize_pool_down[players_bet[_addr].round];

        if (betPool == 0) return 0; // Avoid division by zero
        return (players_bet[_addr].bet * roundPool) / betPool;
    }

    function getPendingWithdraw(address _addr) public view returns (uint256) {
        if (players_bet[_addr].isExist == false) {
            return 0;
        }
        if (players_bet[_addr].round == round) {
            return 0; // Round still going
        }

        uint256 bet_round = players_bet[_addr].round;
        if (players_bet[_addr].up_down != roundWinner[bet_round]) {
            return 0; // Loser
        }
        return _calculateAmount(_addr);
    }

    function _startRound(uint256 seed) private {
        prize_pool[round] = seed;
        prize_pool_up[round] = 0;
        prize_pool_down[round] = 0;
        price_open = getPrice();
        ts_start = block.timestamp;
        emit eventStartRound(round, ts_start, price_open, seed);
    }

    function addToPrizePool() public payable {
        require(msg.value > 0, "Minimum amount to add = 1 wei");
        prize_pool[round] += msg.value;
        emit eventAddToPrizePool(round, msg.sender, msg.value);
    }

    function bet(UP_DOWN _up_down) public payable {
        require(msg.value > 0, "Minimum bet = 1 wei");
        require(block.timestamp - ts_start <= 3600, "Betting closed");

        if (players_bet[msg.sender].isExist == true) {
            if (players_bet[msg.sender].round == round) {
                // Player have aleardy bet this round
                revert("Bet already placed this round");
            } else if (
                players_bet[msg.sender].up_down ==
                roundWinner[players_bet[msg.sender].round]
            ) {
                // Player have pending withdrawal
                revert("Pending withdrawal");
            }
        }

        // if player doesn't exist yet we add the player
        players_bet[msg.sender].bet = msg.value;
        players_bet[msg.sender].up_down = _up_down;
        players_bet[msg.sender].round = round;
        players_bet[msg.sender].isExist = true;

        // add the amount to the prizpool
        if (_up_down == UP_DOWN.UP) {
            prize_pool_up[round] += msg.value;
        } else {
            prize_pool_down[round] += msg.value;
        }
        prize_pool[round] += msg.value;
        emit eventBet(round, msg.sender, msg.value, _up_down);
    }

    function withdraw() public nonReentrant {
        require(
            players_bet[msg.sender].isExist == true,
            "Player doesn't exist"
        );
        require(players_bet[msg.sender].round < round, "Round still ongoing");
        require(
            players_bet[msg.sender].up_down ==
                roundWinner[players_bet[msg.sender].round],
            "Not a winner"
        );
        players_bet[msg.sender].isExist = false;
        // prize_pool up or down
        uint256 amount = _calculateAmount(msg.sender);
        (bool sent, ) = msg.sender.call{value: amount}("");
        require(sent, "Withdraw failed"); // dev:withdraw failed
    }

    function withdrawFee() public nonReentrant {
        require(fee > 0, "No fees to withdraw");
        (bool sent, ) = dev.call{value: fee}("");
        require(sent, "Failed to withdraw fee"); // dev:withdraw fee failed
    }

    function endTurn() public {
        require(
            block.timestamp - ts_start >= 1 hours,
            "Minimum round duration is 24 hours"
        );
        uint256 seed = 0;
        UP_DOWN up_down;
        price_close = getPrice();

        // calculate fee
        uint256 devTax = prize_pool[round] / 100; // 1% dev fee
        fee += devTax;
        prize_pool[round] -= devTax;

        // process winners
        if (price_close >= price_open) {
            up_down = UP_DOWN.UP;
            if (prize_pool_up[round] == 0) {
                // if no player won
                seed = prize_pool[round];
            }
            // UP wins if no price change
        } else if (price_close < price_open) {
            up_down = UP_DOWN.DOWN;
            if (prize_pool_down[round] == 0) {
                // if no player won
                seed = prize_pool[round];
            }
        }

        roundWinner[round] = up_down;

        emit eventEndTurn(
            round,
            block.timestamp,
            price_close,
            prize_pool[round],
            prize_pool_up[round],
            prize_pool_down[round]
        );

        // Reset variables for new round
        round += 1;
        _startRound(seed); // New round
    }
}
